/**
 * @param {string} s
 * @return {number}
 */
var numSub = function(s) {
  s = s + '0' // 格式化输入
  // const arr = []
  let count = 0
  let isEnd = true
  let res = 0
  function helper (n) {
    // 1 1
    // 2 1 + 2
    // 3 3 + 2 + 1
    return (n + 1) * n / 2
  }
  for (let i = 0; i < s.length; ++i) {
    if (s[i] === '1') {
      // console.warn('为1的i', i)
      // console.warn('isEnd', isEnd)
      if (isEnd) {
        isEnd = false
        count = 1
      } else {
        count++
      }
    } else {
      // console.warn('i', i)
      // console.warn('isEnd', isEnd)
      // 1后面的0
      if (!isEnd) {
        isEnd = true
        // arr.push(count)
        console.warn('count', count)
        res += helper(count)
        count = 0
      } else {
        // 为0 , 而且结束了
        isEnd = true
      }
    }
  }
  // console.warn('res', res)
  // return res
  if (res < 10^9 + 7) {
    return res
  } else {
    return res % (10^9 + 7) // 为啥
  }
};

const n = ""

console.warn('n', numSub(n))
console.warn('3200542526', 3200542526 % (10^9 + 7))
